sys_variable_value.value:
(function execute(inputs, outputs) {
  if (inputs.responseBody) {
    var returnedObject = JSON.parse(inputs.responseBody);
    if (returnedObject) {
      outputs.ws1uuid = returnedObject.Uuid;
      outputs.ws1platform = returnedObject.Platform;
      outputs.ws1enrollmentstatus = returnedObject.EnrollmentStatus;
      if (returnedObject.Id) {
        outputs.ws1id = returnedObject.Id.Value;
      }
    }
  }
})(inputs, outputs);

